import React from "react";
import classes from "./rPosition.module.css";

const rPosition = () => {
  return (
    <div className={classes.table}>
      <table>
        <tr>
          <th>Name</th>
          <th>Telephone</th>
          <th>Telephone</th>
        </tr>
        <tr>
          <td>Bill Gates</td>
          <td>555 77 854</td>
          <td>555 77 855</td>
        </tr>
      </table>
    </div>
  );
};

export default rPosition;
